import React from "react";
import Slider from "react-slick";
import projectData from '../data/projectData';
import WhiteTypography from './WhiteTypography';
import ProjectCard from './ProjectCard';
import { Box } from "@mui/material";
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import defaultImg from "../images/defaultImg.png"
import { Button, CardActionArea, CardActions } from '@mui/material';

const projectColors = ['#CB6BA8', '#DA8A7F', '#DA8A7F', '#C158C2', '#6D20F2', '#6D20F2', '#b160ec', '#CB6BA8']

export default function ProjectSlider() {
    const settings = {
        className: "center",
        centerMode: true,
        infinite: true,
        centerPadding: "20px",
        slidesToShow: 4,
        speed: 500
    };

    const data1 = projectData[1]
    return (
        <div className="container" style={{ marginTop: "5rem" }}>
            <link
                rel="stylesheet"
                type="text/css"
                charset="UTF-8"
                href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick.min.css"
            />
            <link
                rel="stylesheet"
                type="text/css"
                href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick-theme.min.css"
            />
            <WhiteTypography variant="h4">Center Mode</WhiteTypography>
            <Slider {...settings} style={{ marginTop: "5rem" }}>
                <div>
                <ProjectCard title={data1.title} desc={data1.desc} tech={data1.tech} img={data1.img} color1={projectColors[0]} color2={projectColors[1]} />
                </div>
                <div>
                <ProjectCard title={data1.title} desc={data1.desc} tech={data1.tech} img={data1.img} color1={projectColors[1]} color2={projectColors[2]} />
                </div>
                <div>
                    <ProjectCard title={data1.title} desc={data1.desc} tech={data1.tech} img={data1.img} color1={projectColors[2]} color2={projectColors[3]} />
                </div>
                <div>
                <ProjectCard title={data1.title} desc={data1.desc} tech={data1.tech} img={data1.img} color1={projectColors[3]} color2={projectColors[4]} />
                </div>
                <div>
                <ProjectCard title={data1.title} desc={data1.desc} tech={data1.tech} img={data1.img} color1={projectColors[4]} color2={projectColors[5]} />
                </div>
                <div>
                <ProjectCard title={data1.title} desc={data1.desc} tech={data1.tech} img={data1.img} color1={projectColors[5]} color2={projectColors[6]} />
                </div>
            </Slider>
        </div>
    );
}

